import React, { useState, useEffect } from "react";
import axios from "axios";
import "./ResourcesPage.css"; // Link to the CSS file

const ResourcesPage = () => {
  const [resources, setResources] = useState([]);
  const [loading, setLoading] = useState(true);
  const [message, setMessage] = useState("");
  const [file, setFile] = useState(null);
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");
  const [searchQuery, setSearchQuery] = useState("");

  // Fetch resources from backend
  useEffect(() => {
    axios
      .get("http://localhost:8000/resources/all")
      .then((response) => {
        setResources(response.data.resources);
        setLoading(false);
      })
      .catch((err) => {
        console.error("Error fetching resources:", err);
        setMessage("Error loading resources.");
        setLoading(false);
      });
  }, []);

  // Filter resources based on search query
  const filteredResources = resources.filter(
    (resource) =>
      resource.title.toLowerCase().includes(searchQuery.toLowerCase()) ||
      (resource.description &&
        resource.description.toLowerCase().includes(searchQuery.toLowerCase()))
  );

  // Handle resource upload
  const handleUpload = async (e) => {
    e.preventDefault();

    if (!file || !title) {
      alert("Please provide a file and title.");
      return;
    }

    const formData = new FormData();
    formData.append("file", file);
    formData.append("title", title);
    formData.append("description", description);

    try {
      console.log("Sending form data:", formData); // Log form data

      const response = await axios.post(
        "http://localhost:8000/resources/upload",
        formData,
        {
          headers: { "Content-Type": "multipart/form-data" },
        }
      );

      console.log("Backend response:", response.data); // Log backend response

      if (response.data.success) {
        alert("Resource uploaded successfully!");
        setResources([...resources, response.data.resource]);
      } else {
        alert("Failed to upload resource.");
      }
    } catch (error) {
      console.error("Upload error:", error.response || error.message); // Log any errors
      alert("An error occurred while uploading.");
    }
  };

  // Handle download of a file
  const handleDownload = (fileUrl) => {
    if (!fileUrl) {
      alert("File URL is missing.");
      return;
    }
    window.open(fileUrl, "_blank");
  };

  // Handle sharing a file URL
  const handleShare = (fileUrl) => {
    navigator.clipboard
      .writeText(fileUrl)
      .then(() => alert("File URL copied to clipboard!"))
      .catch(() => alert("Failed to copy URL."));
  };

  return (
    <div className="main-container">
      <div className="left-panel">
        <h2>Manage Resources</h2>
        <div className="search-container">
          <input
            type="text"
            placeholder="Search resources..."
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
            className="search-input"
          />
        </div>
        <div className="resource-grid">
          {loading && <p>Loading resources...</p>}
          {message && <p>{message}</p>}
          {filteredResources.map((resource) => (
            <div key={resource.resource_id} className="resource-box">
              <h3>{resource.title}</h3>
              <p>{resource.description}</p>
              <div className="box-buttons">
                <button
                  className="download-btn"
                  onClick={() => handleDownload(resource.file_url)}
                >
                  Download
                </button>
                <button
                  className="share-btn"
                  onClick={() => handleShare(resource.file_url)}
                >
                  Share
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>

      <div className="right-panel">
        <h2>Upload Resource</h2>
        <form className="upload-form" onSubmit={handleUpload}>
          <input
            type="text"
            placeholder="Resource Title"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            className="input-field"
            required
          />
          <textarea
            placeholder="Description"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            className="textarea-field"
          />
          <input
            type="file"
            onChange={(e) => setFile(e.target.files[0])}
            className="file-input"
            required
          />
          <button type="submit" className="upload-btn">
            Upload
          </button>
        </form>
      </div>
    </div>
  );
};

export default ResourcesPage;
